import React from 'react';
import styled from 'styled-components';
import { FaLeaf, FaBoxOpen, FaFireAlt } from 'react-icons/fa';

const HeaderBar = styled.header`
  width: 100%;
  background: #f8f5f2;
  display: flex;
  align-items: stretch;
  justify-content: center;
  padding: 0;
  min-height: 340px;
  position: relative;
  box-shadow: 0 2px 8px rgba(0,0,0,0.03);
  @media (max-width: 900px) {
    flex-direction: column;
    min-height: 0;
    padding-bottom: 2rem;
  }
`;
const ImgWrap = styled.div`
  flex: 0 0 340px;
  display: flex;
  align-items: flex-end;
  justify-content: center;
  background: none;
  @media (max-width: 900px) {
    flex: none;
    width: 100%;
    justify-content: center;
    align-items: center;
    padding-top: 2rem;
  }
`;
const CookieImg = styled.img`
  width: 260px;
  height: auto;
  object-fit: contain;
  filter: drop-shadow(0 8px 32px rgba(124,94,60,0.10));
  @media (max-width: 700px) {
    width: 160px;
  }
`;
const Content = styled.div`
  flex: 1 1 0;
  display: flex;
  flex-direction: column;
  justify-content: center;
  padding: 2.5rem 3rem 2.5rem 2rem;
  @media (max-width: 900px) {
    padding: 1.5rem 1rem 0 1rem;
    align-items: center;
    text-align: center;
  }
`;
const Title = styled.h1`
  font-family: 'DM Serif Display', 'Playfair Display', serif;
  font-size: 2.8rem;
  color: #6b6e58;
  font-weight: 700;
  margin: 0 0 1.2rem 0;
  letter-spacing: 0.01em;
  line-height: 1.1;
  @media (max-width: 700px) {
    font-size: 1.7rem;
  }
`;
const Subtitle = styled.p`
  font-family: 'Montserrat', sans-serif;
  color: #7c5e3c;
  font-size: 1.15rem;
  margin: 0 0 2.2rem 0;
  font-weight: 500;
  @media (max-width: 700px) {
    font-size: 1rem;
  }
`;
const HighlightsRow = styled.div`
  display: flex;
  align-items: stretch;
  gap: 0;
  @media (max-width: 700px) {
    flex-direction: column;
    align-items: center;
    gap: 0.7rem;
  }
`;
const Highlight = styled.div`
  display: flex;
  align-items: center;
  gap: 0.9rem;
  padding: 0 1.5rem;
  min-width: 160px;
  @media (max-width: 700px) {
    padding: 0.7rem 0;
    min-width: 0;
    justify-content: center;
  }
`;
const Divider = styled.div`
  width: 1px;
  background: #e0d7c7;
  margin: 0 0.5rem;
  @media (max-width: 700px) {
    width: 60%;
    height: 1px;
    margin: 0.2rem 0;
    align-self: center;
  }
`;
const IconWrap = styled.div`
  font-size: 1.5rem;
  color: #b08d57;
  display: flex;
  align-items: center;
`;
const HighlightText = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  @media (max-width: 700px) {
    align-items: center;
  }
`;
const HighlightTitle = styled.div`
  font-family: 'Montserrat', sans-serif;
  font-size: 1.08rem;
  font-weight: 700;
  color: #6b6e58;
`;
const HighlightDesc = styled.div`
  font-family: 'Montserrat', sans-serif;
  font-size: 0.97rem;
  color: #7c5e3c;
  font-weight: 400;
`;

export default function Header() {
  return (
    <HeaderBar>
      <ImgWrap>
        <CookieImg src="/cookie.png" alt="Bakery Cookie" />
      </ImgWrap>
      <Content>
        <Title>The Sweetest Haven for Freshly Baked</Title>
        <Subtitle>
          Welcome to your premium bakery experience. Enjoy our signature treats, crafted with love and the finest ingredients.
        </Subtitle>
        <HighlightsRow>
          <Highlight>
            <IconWrap><FaLeaf /></IconWrap>
            <HighlightText>
              <HighlightTitle>Nutrient-rich</HighlightTitle>
              <HighlightDesc>Wholesome, healthy ingredients.</HighlightDesc>
            </HighlightText>
          </Highlight>
          <Divider />
          <Highlight>
            <IconWrap><FaFireAlt /></IconWrap>
            <HighlightText>
              <HighlightTitle>100% Bake</HighlightTitle>
              <HighlightDesc>Fresh from our oven, daily.</HighlightDesc>
            </HighlightText>
          </Highlight>
          <Divider />
          <Highlight>
            <IconWrap><FaBoxOpen /></IconWrap>
            <HighlightText>
              <HighlightTitle>Secure Packaging</HighlightTitle>
              <HighlightDesc>Delivered safe and fresh.</HighlightDesc>
            </HighlightText>
          </Highlight>
        </HighlightsRow>
      </Content>
    </HeaderBar>
  );
}
